DELIMITER ;;
CREATE DEFINER=`admin`@`%` PROCEDURE `dashboard1`(IN monthOrder INT, yearOrder INT)
BEGIN

SELECT
	1 AS ID,
	`Month`,
    FORMAT(`SalesGoal`,2) AS 'SalesGoal',
    FORMAT(`Sales`,2) AS 'Sales',
    ROUND(IFNULL((`Sales` / `SalesGoal`) * 100.00,0),2) AS 'SalesPercentage',
    FORMAT(`Sales`,2) AS 'ShippedGoal',
    FORMAT(`Shipped`,2) AS 'Shipped',
    ROUND(IFNULL((`Shipped` / `Sales`) * 100.00,0),2) AS 'ShippingPercentage',
    FORMAT(`Shipped`,2) AS 'DeliveredGoal',
    FORMAT(`Delivered`,2) AS 'Delivered',
    ROUND(IFNULL((`Delivered` / `Shipped`) * 100.00,0),2) AS 'DeliveredPercentage',
    FORMAT(`Delivered`,2) AS 'PaidGoal',
    FORMAT(`Paid`,2) AS 'Paid',
    ROUND(IFNULL((`Paid` / `Delivered`) * 100.00,0),2) AS 'PaidPercentage',
    DATE_FORMAT(NOW(), "%M %d %Y %r") AS 'CurrentDateTime'
FROM
	(
		SELECT
			aa.`Month`,
			IFNULL(aa.`SalesGoal`,0) AS `SalesGoal`,
			IFNULL(aa.`Sales`,0) AS `Sales`,
			IFNULL(bb.`Shipped`,0) AS `Shipped`,
            IFNULL(cc.`Delivered`,0) AS `Delivered`,
            IFNULL(dd.`Paid`,0) AS `Paid`
		FROM
			(
				SELECT
                    YEAR(DateOrdered) AS 'Year',
					MONTHNAME(DateOrdered) AS 'Month',
					CONVERT('15000000',DECIMAL) AS 'SalesGoal',
					SUM(CodAmount) AS 'Sales'
				FROM
					topyugo.orders
				WHERE
					MONTH(DateOrdered) = monthOrder
                    AND
                    YEAR(DateOrdered) = yearOrder
				GROUP BY
					YEAR(DateOrdered),
					MONTHNAME(DateOrdered)
			) aa
		LEFT JOIN
			(
				SELECT
                    YEAR(DateOrdered) AS 'Year',
					MONTHNAME(DateOrdered) AS 'Month',
					SUM(OrderAmount) AS 'Shipped'
				FROM
					topyugo.orders
				WHERE
					OrderStatus = 'SHIPPED'
					AND
					MONTH(DateOrdered) = monthOrder
                    AND
                    YEAR(DateOrdered) = yearOrder
				GROUP BY
					YEAR(DateOrdered),
					MONTHNAME(DateOrdered)
			) bb
		ON	
			aa.`Month` = bb.`Month`
		LEFT JOIN
			(
				SELECT
                    YEAR(DateOrdered) AS 'Year',
					MONTHNAME(DateOrdered) AS 'Month',
					SUM(OrderAmount) AS 'Delivered'
				FROM
					topyugo.orders
				WHERE
					OrderStatus = 'DELIVERED'
					AND
					MONTH(DateOrdered) = monthOrder
                    AND
                    YEAR(DateOrdered) = yearOrder
				GROUP BY
					YEAR(DateOrdered),
					MONTHNAME(DateOrdered)
			) cc
		ON	
			aa.`Month` = cc.`Month`
		LEFT JOIN
			(
				SELECT
                    YEAR(DateOrdered) AS 'Year',
					MONTHNAME(DateOrdered) AS 'Month',
					SUM(OrderAmount) AS 'Paid'
				FROM
					topyugo.orders
				WHERE
					OrderStatus = 'PAID'
					AND
					MONTH(DateOrdered) = monthOrder
                    AND
                    YEAR(DateOrdered) = yearOrder
				GROUP BY
					YEAR(DateOrdered),
					MONTHNAME(DateOrdered)
			) dd
		ON	
			aa.`Month` = dd.`Month`
    ) aa;

END ;;
DELIMITER ;
