CREATE DEFINER=`admin`@`%` PROCEDURE `dashboard3`(IN monthOrder INT, yearOrder INT)
BEGIN

SELECT
	aa.`Month`,
    aa.`Year`,
    FORMAT(IFNULL((aa.Sales1 / bb.Sales2) * 100,0),2) AS 'RTS_Projection',
    FORMAT(IFNULL((aa.Sales1 / ee.Sales3),0),2) AS 'RTS_Rate',
    FORMAT(IFNULL((aa.Sales1 * ((dd.TotalSales / cc.TotalOrders))),0),2) AS 'RTS_Value',
    FORMAT(IFNULL((aa.Sales1 * 110),0),2) AS 'RS_Loss',
