	(
		SELECT
			MONTH(DateOrdered) AS 'Month',
            YEAR(DateOrdered) AS 'Year',
			SUM(CodAmount) AS 'Sales1'
		FROM
			topyugo.orders
		WHERE
			OrderStatus IN ('RTS','RRTS')
			AND
			MONTH(DateOrdered) = monthOrder
			AND
			YEAR(DateOrdered) = yearOrder
		GROUP BY
			MONTH(DateOrdered),
			YEAR(DateOrdered)
    ) aa
LEFT JOIN
	(
		SELECT
			MONTH(DateOrdered) AS 'Month',
            YEAR(DateOrdered) AS 'Year',
			SUM(CodAmount) AS 'Sales2'
		FROM
			topyugo.orders
		WHERE
			OrderStatus IN ('RTS','RRTS','PAID','DELIVERED','RESHIPPED','ODZ','UNTRACEABLE')
			AND
			MONTH(DateOrdered) = monthOrder
			AND
			YEAR(DateOrdered) = yearOrder
		GROUP BY
			MONTH(DateOrdered),
			YEAR(DateOrdered)
    ) bb
ON
	aa.`Month` = bb.`Month`
    AND
	aa.`Year` = bb.`Year`
LEFT JOIN
	(
		SELECT
			MONTH(DateOrdered) AS 'Month',
            YEAR(DateOrdered) AS 'Year',
			COUNT(DISTINCT CONCAT(OrderNo, Product)) AS 'TotalOrders'
