			MONTH(DateOrdered) = monthOrder
			AND
			YEAR(DateOrdered) = yearOrder
		GROUP BY
			MONTH(DateOrdered),
			YEAR(DateOrdered)
    ) cc
ON
	aa.`Month` = cc.`Month`
    AND
	aa.`Year` = cc.`Year`
LEFT JOIN
	(
		SELECT
			MONTH(DateOrdered) AS 'Month',
            YEAR(DateOrdered) AS 'Year',
			SUM(CodAmount) AS 'TotalSales'
		FROM
			topyugo.orders
		WHERE
			MONTH(DateOrdered) = monthOrder
			AND
			YEAR(DateOrdered) = yearOrder
		GROUP BY
			MONTH(DateOrdered),
			YEAR(DateOrdered)
    ) dd
ON
	aa.`Month` = dd.`Month`
    AND
	aa.`Year` = dd.`Year`
LEFT JOIN
	(
		SELECT
			MONTH(DateOrdered) AS 'Month',
            YEAR(DateOrdered) AS 'Year',
			SUM(CodAmount) AS 'Sales3'
		FROM
			topyugo.orders
		WHERE
			OrderStatus IN ('RTS','RRTS','SHIPPED','PAID','DELIVERED','RESHIPPED','ODZ','UNTRACEABLE')
			AND
			MONTH(DateOrdered) = monthOrder
			AND
			YEAR(DateOrdered) = yearOrder
		GROUP BY
			MONTH(DateOrdered),
			YEAR(DateOrdered)
    ) ee
ON
	aa.`Month` = ee.`Month`
    AND
	aa.`Year` = ee.`Year`;

