CREATE DEFINER=`admin`@`%` PROCEDURE `dashboard4`(IN monthOrder INT, yearOrder INT)
BEGIN

SELECT
	aa.*,
    FORMAT(IFNULL(bb.TotalOrders,0),0) AS TotalOrders
FROM
	(
		SELECT
			MONTH(DateOrdered) AS 'Month',
            YEAR(DateOrdered) AS 'Year',
			OrderStatus,
			FORMAT(COUNT(DISTINCT CONCAT(OrderNo, Product)),0) AS 'Count'
		FROM
			topyugo.orders
		WHERE
			MONTH(DateOrdered) = monthOrder
			AND
			YEAR(DateOrdered) = yearOrder
		GROUP BY
			OrderStatus,
			MONTH(DateOrdered),
			YEAR(DateOrdered)
	) aa
LEFT JOIN
	(
		SELECT
			MONTH(DateOrdered) AS 'Month',
            YEAR(DateOrdered) AS 'Year',
			COUNT(DISTINCT CONCAT(OrderNo, Product)) AS 'TotalOrders'
		FROM
			topyugo.orders
		WHERE
			MONTH(DateOrdered) = monthOrder
			AND
			YEAR(DateOrdered) = yearOrder
		GROUP BY
			MONTH(DateOrdered),
			YEAR(DateOrdered)
    ) bb
ON
	aa.`Month` = bb.`Month`
    AND
	aa.`Year` = bb.`Year`;
    
END ;;
