DELIMITER ;;
CREATE DEFINER=`admin`@`%` PROCEDURE `dashboard5`(IN monthOrder INT, yearOrder INT)
BEGIN

SELECT
	RANK() OVER (ORDER BY aa.Sales DESC) AS 'Rank',
	aa.Product,
    FORMAT(aa.Sales,2) AS 'Sales',
    FORMAT((aa.Sales / bb.TotalSales) * 100,2) AS 'SalesRate'
FROM
	(
		SELECT
			MONTH(DateOrdered) AS 'Month',
            YEAR(DateOrdered) AS 'Year',
			Product,
			SUM(CodAmount) AS 'Sales'
		FROM
			topyugo.orders
		WHERE
			MONTH(DateOrdered) = monthOrder
			AND
			YEAR(DateOrdered) = yearOrder
		GROUP BY
			Product,
            MONTH(DateOrdered),
            YEAR(DateOrdered)
	) aa
LEFT JOIN
	(
		SELECT
			MONTH(DateOrdered) AS 'Month',
            YEAR(DateOrdered) AS 'Year',
			SUM(CodAmount) AS 'TotalSales'
		FROM
			topyugo.orders
		WHERE
			MONTH(DateOrdered) = monthOrder
			AND
			YEAR(DateOrdered) = yearOrder
		GROUP BY
			MONTH(DateOrdered),
            YEAR(DateOrdered)
	) bb
ON
	aa.`Month` = bb.`Month`
    AND
	aa.`Year` = bb.`Year`
ORDER BY
	aa.Sales DESC
LIMIT 10;

END ;;
DELIMITER ;